import React from "react";
import Header from "./Header";
import NotFoundPage from "./NotFoundPage";
import Nav from "./Nav";
import { DebugRouter, Route, Switch } from "react-router-dom";
import Home from "./Home";
import WholeTutorial from "./components/WholeTutorial";
import { lessonList } from "./lessons/lessons";

function App(props) {
  return (
    <div className="general">
      <Header />
      <div className="row">
        <div className="col-sm-2">
          <Nav />
        </div>
        <div className="col-sm-10">
          <DebugRouter>
            <Switch>
              <Route path="/" exact>
                <Home isAuthed={true} />
              </Route>
              <Route path={"/" + lessonList()[0].title}>
                <WholeTutorial lesson={lessonList()[0]} isAuthed={true} />
              </Route>
              <Route>
                <NotFoundPage />
              </Route>
            </Switch>
          </DebugRouter>
        </div>
      </div>
    </div>
  );
}

export default App;
